import styled from 'styled-components';

export const HomeWrapper = styled.div`
	overflow: hidden;
	width: 960px;
	margin: 0 auto;
`;

export const HomeLeft = styled.div`
	width: 625px;
	margin-left: 15px;
	padding-top: 30px;
	float: left;
	.banner-img {
		width: 625px;
		height: 270px;
	}
`;


export const HomeRight = styled.div`
	width: 240px;
	float: right;
`;

export const TopicWrapper = styled.div`
	overflow: hidden;
	padding: 20px 0 10px 0;
`;

export const TopicItem = styled.div`
	float: left;
	padding-right: 10px;
	background: #f7f7f7;
	height: 32px;
	line-height: 32px;
	font-size: 14px;
	color: #000;
	border: solid 1px #dcdcdc;
	border-radius: 4px;
	.topic-pic{
		display: block;
		float: left;
		margin-right: 10px;
		width: 32px;
		height: 32px;
	}
`;
